import './App.css';
import React, { useState} from 'react';
import AddBookForm from './AddBookForm';
import BookList from './BookList';

function App() {

  const [books,setBooks] = useState[ 
    { id: 1, title: "Book1" },
    { id: 2, title: 'Book 2' },
    { id: 3, title: 'Book 3' }
  ];

  return (
    <>
    <h1 id="title">Favorite Books</h1>
    <AddBookForm/>
    <BookList book={books}/>
    </>
  );
}

export default App;
